import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  // Exemplo de dados fictícios
  const posts = [
    { id: 1, title: 'Introdução ao React', content: 'Conteúdo da introdução ao React.' },
    { id: 2, title: 'Hooks no React', content: 'Conteúdo sobre o uso de hooks no React.' },
    // Adicione mais posts conforme necessário
  ];

  return (
    <div>
      <h2>Latest Posts</h2>
      <ul>
        {posts.map(post => (
          <li key={post.id}>
            <Link to={`/post/${post.id}`}>{post.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
